import { ContainerAnimation, WapperAnimation } from "./AnimationStyle";
import RootSvg from "./RootSvg";

const BoxAnimation = () => {
  return (
    <WapperAnimation>
      <ContainerAnimation>
        <RootSvg/>
      </ContainerAnimation>
    </WapperAnimation>
  );
};
export default BoxAnimation;
